he most common probiotics to turn up on the dinner table or at the dessert counter are lactic-acid bacteria, found in yogurts and cheeses made with live cultures. These bacteria aid in breaking down lactose and other sugars, which makes them particularly helpful to the lactose intolerant. Studies have also suggested that some probiotics might help soothe recurring digestive issues and even fight respiratory infections. </p>\n\n<p><strong>Micro Warriors</strong></p>\n\n<p>Probiotic bacteria must face a number of obstacles to have these beneficial effects on our bodies. A giving serving of yogurt has only a few billion bacteria versus our gut\u2019s tens of trillions, and they\u2019re vulnerable to changes in oxygen, light, and temperature. But a 2011 study in <em>Science Translational Medicine</em> suggested they don\u2019t need to take over in order to help out\u2014instead, it seems that they communicate with the body\u2019s native flora to spark larger chain reactions. Some yogurt-makers now take extra care to preserve the probiotics in their cultures for maximal effect, and other common natural sources include fermented foods such as brewer\u2019s yeast, miso, and sauerkraut.</p>','soldQuantity':-1,'limitedQuantityRemaining':null,'tippingPoint':0,'soldQuantityMessage':'-1','placeholderUrl':'https://secure-assets.grouponcdn.com/images/groupon/grayPlaceholder.png','grid4ImageUrl':'https://img.grouponcdn.com/deal/mXpBm5JYPyKszueiWfEW/vL-700x420/v1/t300x182.jpg','grid6ImageUrl':'https://img.grouponcdn.com/deal/mXpBm5JYPyKszueiWfEW/vL-700x420/v1/t460x279.jpg','largeImageUrl':'https://img.grouponcdn.com/deal/mXpBm5JYPyKszueiWfEW/vL-700x420/v1/t440x300.jpg','mediumImageUrl':'https://img.grouponcdn.com/deal/mXpBm5JYPyKszueiWfEW/vL-700x420/v1/t100x100.jpg','smallImageUrl':'https://img.grouponcdn.com/deal/mXpBm5JYPyKszueiWfEW/vL-700x420/v1/t50x50.jpg','sidebarImageUrl':'https://img.grouponcdn.com/deal/mXpBm5JYPyKszueiWfEW/vL-700x420/v1/t200x300.jpg','status':'open','type':